import React from "react";
import { useState } from "react";
import AuthStyle from "../../../../styles/Auth/Auth.css";
import { useNavigate } from "react-router";
import { useDispatch } from "react-redux";
import { fetchRegister } from "../../../../redux/reducers/TypeAuth";
import Input from '@mui/joy/Input';
import Button from '@mui/joy/Button';
import Select from '@mui/joy/Select';
import Option from '@mui/joy/Option';
import { Box, Chip } from '@mui/joy'


const { FormAuth } = AuthStyle


function Regist(props) {

    const [login, setLogin] = useState()

    const { flagCaptcha } = props

    const navigate = useNavigate()
    const dispatch = useDispatch()

    let pass = "",
        secPass = "",
        faculty = "",
        age = 0,
        gender = "",
        hobby = []


    function sendData() {
        let data = {
            login: login,
            pass: pass,
            secPass: secPass
        }
        console.log(data)
        dispatch(fetchRegister({ data }))
    }


    return (
        <>
            <FormAuth onSubmit={(e) => {
                e.preventDefault();
                e.target.reset();
            }}>
                <Input
                    onChange={(event) => { setLogin }}
                    placeholder="Введите логин"
                    size="md"
                    variant="soft"
                    type="email"
                    required={true}
                />
                <Input
                    onChange={(event) => { pass = event.target.value }}
                    type="password"
                    placeholder="Введите пароль"
                    size="md"
                    variant="soft"
                    required={true}
                />
                <Input
                    onChange={(event) => { secPass = event.target.value }}
                    type="password"
                    placeholder="Повторите пароль"
                    size="md"
                    variant="soft"
                    required={true}
                />
                <Input
                    onChange={(event) => { login = event.target.value }}
                    placeholder="Имя"
                    size="md"
                    variant="soft"
                    type="text"
                    required={true}
                />
                <Input
                    onChange={(event) => { age = event.target.value }}
                    placeholder="Возраст"
                    size="md"
                    variant="soft"
                    type="number"
                    min="18"
                    required={true}
                />
                <Select required={true} placeholder="Пол" onChange={(event, newValue) => { gender = newValue }}>
                    <Option value="Мужской">Мужской</Option>
                    <Option value="Женский">Женский</Option>
                </Select>
                <Select required={true} placeholder="Факультет" onChange={(event, newValue) => { faculty = newValue }}>
                    <Option value="ФГИиБ">ФГИиБ</Option>
                    <Option value="ФОП">ФОП</Option>
                    <Option value="КФ">КФ</Option>
                    <Option value="ПГ">ПГ</Option>
                </Select>
                <Select
                    multiple
                    style={{dispay: "flex"}}
                    placeholder="Увлечения"
                    defaultValue={[]}
                    onChange={(target, newValue) => {
                        hobby = newValue
                        console.log(newValue)
                    }}
                    renderValue={(selected) => (
                        <Box sx={{ display: 'flex', flexWrap: "wrap", gap: '0.25rem' }}>
                            {selected.map((selectedOption) => (
                                <Chip variant="soft" color="primary">
                                    {selectedOption.label}
                                </Chip>
                            ))}
                        </Box>
                    )}
                    sx={{
                        minWidth: '15rem',
                        maxWidth: "100px"
                    }}
                    slotProps={{
                        listbox: {
                            sx: {
                                width: '100%',
                            },
                        },
                    }}
                >
                    <Option value="Вектор">Вектор</Option>
                    <Option value="Спортклуб">Спортклуб</Option>
                    <Option value="Турклуб">Турклуб</Option>
                    <Option value="Продакшн">Продакшн</Option>
                </Select>

                <Button type="submit" disabled={!flagCaptcha} onClick={sendData}>Войти</Button>
            </FormAuth >
        </>
    )
}

export default Regist
